import React from 'react';

const Footer = () => {
  return (
    <header>
        <div class="header">
  <a href="#default" class="logo">CompanyLogo</a>
  <div class="header-right">
    <a class="active" href="#home">Home</a>
    <a href="#contact">Contact</a>
    <a href="#about">About</a>
  </div>
</div>
    </header>
  );
};

export default Footer;
